import React from 'react'
import { Stack } from '@mui/material'
import {logo} from "../util.jsx/constants"
const Navbar = () => {
  return (
    <Stack direction="row" display="flex" alignItems="center">
      <img src={logo} height={45} alt="" />
    </Stack>
  )
}

export default Navbar
